import React, {useState} from 'react';
import './index.css';
const App = ()=>{
    const [inputItem, setInputItem] = useState();
    
    const InputEvent = (event)=>{
       const value = event.target.value;
       setInputItem(value);
    }



    return (
        <>
            <div className='main_div'>
                <div className='center_div'>
                    <h1>ToDo List</h1>
                    <input type='text' placeholder='Add Item in List' name={inputItem} onChange={InputEvent}/>
                    <button>+</button>
                    <ol>
                        <li>Hello</li>
                    </ol>

                </div>


            </div>
        </>
    );
}

export default App;
